import classNames from 'classnames';
import './Hamburger.scss';

const Hamburger = ({ toggleMenu, isOpen }) => (
  <button
    onClick={toggleMenu}
    className={classNames('hamburger', { 'hamburger--active': isOpen })}
  >
    <span className="hamburger__bar" />
    <span className="hamburger__bar" />
    <span className="hamburger__bar" />
  </button>
);

export default Hamburger;
